        <Route path='/' element={<Shop/>} />
        <Route path='/mens' element={<shopCategory  category="mens" />} />
        <Route path='/womens' element={<shopCategory  category="womens"/>} />
        <Route path='/kids' element={<shopCategory  category="kids"/>} />
